In C, you can terminate a program using the `exit()` function or `return` statement in the `main()` function.

1. `exit()` function: The `exit()` function causes immediate termination of the current process. It takes an integer argument, which is the exit status of the process. Here's an example:

```c
#include <stdlib.h>

int main() {
    // Your code here
    if (some_condition) {
        exit(EXIT_SUCCESS);  // Exit with success status
    } else {
        exit(EXIT_FAILURE);  // Exit with failure status
    }
    // This code will not be executed if exit() is called
    return 0;
}
```

2. `return` statement in `main()`: The `main()` function can also return an integer value to the operating system, which is the exit status of the program. If the `main()` function encounters a `return` statement, the program will terminate immediately. Here's an example:

```c
#include <stdio.h>

int main() {
    // Your code here
    if (some_condition) {
        return 0;  // Exit with success status
    } else {
        return 1;  // Exit with failure status
    }
}
```

In both cases, the program will terminate, and the operating system will receive the exit status, which can be used to determine whether the program executed successfully or not. The `EXIT_SUCCESS` and `EXIT_FAILURE` macros are defined in the `stdlib.h` header file and are commonly used as exit status values.
